-- ------------------------------------------------
-- Version: v1.15
--
-- Description: Migration that introduces the scheme standards relationship
-- -------------------------------------------------

CREATE TABLE k_Identifier_Scheme_Standard (
    ID_IDN_STK integer,
    lodIDN character varying(255) NOT NULL,
    lodSCH character varying(255) NOT NULL,
    lodSTD character varying(255) NOT NULL,
    IDN character varying(255),
    SCH character varying(255),
    STD character varying(255),
    lod_IDN_STK_V character varying(255),
    startDate timestamp with time zone,
    populatedBy character varying(255),
    lastTouch character varying(255),
    PRIMARY KEY (lodIDN, lodSCH, lodSTD),
    FOREIGN KEY (lodIDN) REFERENCES k_Identifier(lodIDN) ON DELETE CASCADE,
    FOREIGN KEY (lodSCH) REFERENCES k_Scheme(lodSCH) ON DELETE CASCADE,
    FOREIGN KEY (lodSTD) REFERENCES k_Standard(lodSTD) ON DELETE CASCADE
);


